    "webPermalink": "https://developer.apple.com/wwdc19/118",
    "description": "At 27, Dr. Ayanna Howard was hired by NASA to lead a team designing a robot for future Mars missions that could think like a human and adapt to change. Her accomplishments since then include being named as one of 2015s most powerful women engineers in the world and as one of Forbes 2018 U.S. Top 50 Women in Tech. From creating robots to studying the impact of global warming on the Antarctic ice shelves to founding a company that develops STEM education and therapy products for children and those with varying needs, Ayanna personifies the responsible global citizen. Hear as she delves into the implications of recent advances in robotics and AI and explains the critical importance of ensuring diversity and inclusion at all stages to reduce the risk of unconscious bias and ensuring robots are designed to be accessible to all.",
